import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, TextInput, Button, View, Text } from 'react-native';
import StartPage from '../StartPage';

let Login = ({navigation}) => {
  return (
    <View style={styles.container}>
        <TextInput style={styles.text} placeholder="Login"/>
        <TextInput secureTextEntry={true} style={styles.text} placeholder="Password"/>
        <Button title="Login" color="#333333" onPress={() => navigation.navigate('StartPage')} />
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  text: {
      borderBottomColor: 'black',
      borderBottomWidth: 2,
      borderStyle: 'solid',
      width: 200,
      marginVertical: 5,
      color: '#333333',
      fontSize: 15,
      marginVertical: 10,
  },
});

export default Login;
